import React from "react";
import { carouselItems } from "../../carouselDB";

export const Carousel = () => {
  return (
    <>
      {carouselItems?.map(({ id, name, image }) => (
        <div
          className="carousel"
          key={id}
          style={{
            overflow: "hidden",
          }}
        >
          <figure style={{ position: "relative", width: "300%" }}>
            <img src={image} alt="" />
          </figure>
        </div>
      ))}
    </>
  );
};
